import { USER_LOGIN } from '../actions';

const INITIAL_STATE = { email: '' };

const user = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  case USER_LOGIN:
    return {
      email: action.email,
    };
  default:
    return state;
  }
};

export default user;
